import React, { useState } from 'react';
import Modal from 'react-modal';
import Button from '../components/Button';
import DeathKnight from '../img/Death_Knight_icon.png';
import DemonHunter from '../img/Demon_Hunter_icon.png';
import Druid from '../img/Druid_icon.png';
import Hunter from '../img/Hunter_icon.png';
import Mage from '../img/Mage_icon.png';
import Paladin from '../img/Paladin_icon.png';
import Priest from '../img/Priest_icon.png';
import Shaman from '../img/Shaman_icon.png';
import Warlock from '../img/Warlock_icon.png';
import Warrior from '../img/Warrior_icon.png';

import '../styles/DeckBuilderPage.scss';

const DeckBuilderPage = () => {
    const [modalIsOpen, setModalIsOpen] = useState(false);
    const [selectedClass, setSelectedClass] = useState(null);

    const openModal = () => {
        setModalIsOpen(true);
    };
    const closeModal = () => {
        setModalIsOpen(false);
    };

    const changeSelectedClass = () => {
        console.log('hi');
    };
    const sayHello = (name) => {
        alert(`Hello, ${name}!`);
    };

    return(
        <div className="deckBuilder">
            <h4>Decks:</h4>
            <Button text='Create New Deck' onClick={openModal} />
            <Modal
                isOpen={modalIsOpen}
                className="classModal"
            >
                <h4>Pick a Class</h4>
                <div className='classes'>
                    <div
                        className='class'
                        onClick={() => changeSelectedClass('deathKnight')}
                    >
                        <img src={DeathKnight} />
                        <p>Death Knight</p>
                    </div>
                    <div
                        className='class'
                        onClick={changeSelectedClass('demonHunter')}
                    >
                        <img src={DemonHunter} />
                        <p>Demon Hunter</p>
                    </div>
                    <div
                        className='class'
                        onClick={changeSelectedClass('druid')}
                    >
                        <img src={Druid} />
                        <p>Druid</p>
                    </div>
                    <div
                        className='class'
                        onClick={changeSelectedClass('hunter')}
                    >
                        <img src={Hunter} />
                        <p>Hunter</p>
                    </div>
                    <div
                        className='class'
                        onClick={changeSelectedClass('mage')}
                    >
                        <img src={Mage} />
                        <p>Mage</p>
                    </div>
                    <div
                        className='class'
                        onClick={changeSelectedClass('paladin')}
                    >
                        <img src={Paladin} />
                        <p>Paladin</p>
                    </div>
                    <div
                        className='class'
                        onClick={changeSelectedClass('priest')}
                    >
                        <img src={Priest} />
                        <p>Priest</p>
                    </div>
                    <div
                        className='class'
                        onClick={changeSelectedClass('shaman')}
                    >
                        <img src={Shaman} />
                        <p>Shaman</p>
                    </div>
                    <div
                        className='class'
                        onClick={changeSelectedClass('warlock')}
                    >
                        <img src={Warlock} />
                        <p>Warlock</p>
                    </div>
                    <div
                        className='class'
                        onClick={changeSelectedClass('warrior')}
                    >
                        <img src={Warrior} />
                        <p>Warrior</p>
                    </div>
                </div>
                <div class='buttons'>
                    <Button text='Cancel' onClick={closeModal} />
                    <Button text='Confirm' onClick={closeModal} />
                </div>
            </Modal>
        </div>
    );
};

export default DeckBuilderPage;
